pragma solidity >=0.5.1 <0.6.0;


contract Calc {
    using SafeMath for uint256;

    uint256 private decimalpercent = 10000;

    uint256[] private ratioOwner;
    uint256[] private ratioShare;
    uint256[] private borderValues;
    uint256[] private dolarRatio;
    uint256[] private dolarValues;

    constructor() public {
        ratioOwner.push(7000);
        ratioOwner.push(3000);

        ratioShare.push(5000);
        ratioShare.push(2000);

        dolarRatio.push(10000);
        dolarRatio.push(0);
    }

    function calcBorder (uint256 _total) public returns (uint256[] memory) {

        uint256 valueAux = 0;
        for (uint256 o = 0; o < ratioOwner.length; o++) {

            //valueAux = _total * ratioOwner[owners[o]] / decimalpercent * shareBorder[owners[o]][borders[b]] / decimalpercent;
            valueAux = _total.mul(ratioOwner[o]).div(decimalpercent).mul(ratioShare[o]).div(decimalpercent);
            borderValues.push(valueAux);
        }

        return borderValues;
    }

    function sharePay() public returns (uint256[] memory) {

        for (uint256 n = 0; n < ratioOwner.length; n++) {
        
            //Futuros problemas aqui
            for (uint256 i = 0; i < dolarRatio.length; i++) {
                uint256 amountPart = borderValues[n].div(decimalpercent);
                if (amountPart != 0) {
                    amountPart = amountPart.mul(dolarRatio[i]);
                }
                else {
                    amountPart = borderValues[n].mul(dolarRatio[i]);
                    amountPart = amountPart.div(decimalpercent);
                }

                dolarValues.push(amountPart);
            }
        }

        return dolarValues;
    }

    function getratioOwner ()  public view returns (uint256[] memory) {
        return ratioOwner;
    }

    function getRatioShare ()  public view returns (uint256[] memory) {
        return ratioShare;
    }

    function getBorderValues ()  public view returns (uint256[] memory) {
        return borderValues;
    }

    function getDolarRatio ()  public view returns (uint256[] memory) {
        return dolarRatio;
    }

    function getDolarValues ()  public view returns (uint256[] memory) {
        return dolarValues;
    }

}


library SafeMath {
    /**
     * @dev Multiplies two unsigned integers, reverts on overflow.
     */
    function mul(uint256 a, uint256 b) internal pure returns (uint256) {
        // Gas optimization: this is cheaper than requiring 'a' not being zero, but the
        // benefit is lost if 'b' is also tested.
        // See: https://github.com/OpenZeppelin/openzeppelin-solidity/pull/522
        if (a == 0) {
            return 0;
        }

        uint256 c = a * b;
        require(c / a == b);

        return c;
    }

    /**
     * @dev Integer division of two unsigned integers truncating the quotient, reverts on division by zero.
     */
    function div(uint256 a, uint256 b) internal pure returns (uint256) {
        // Solidity only automatically asserts when dividing by 0
        require(b > 0);
        uint256 c = a / b;
        // assert(a == b * c + a % b); // There is no case in which this doesn't hold

        return c;
    }

    /**
     * @dev Subtracts two unsigned integers, reverts on overflow (i.e. if subtrahend is greater than minuend).
     */
    function sub(uint256 a, uint256 b) internal pure returns (uint256) {
        require(b <= a);
        uint256 c = a - b;

        return c;
    }

    /**
     * @dev Adds two unsigned integers, reverts on overflow.
     */
    function add(uint256 a, uint256 b) internal pure returns (uint256) {
        uint256 c = a + b;
        require(c >= a);

        return c;
    }

    /**
     * @dev Divides two unsigned integers and returns the remainder (unsigned integer modulo),
     * reverts when dividing by zero.
     */
    function mod(uint256 a, uint256 b) internal pure returns (uint256) {
        require(b != 0);
        return a % b;
    }
}
